N, M = map(int, input().split())
cities = deque()

for _ in range(M):
    cities.append(list(map(int, input().split())))

cities = sorted(cities, key=lambda x: x[1])

prefectures = [[] for _ in range(N)]

for city in cities:
    prefectures[city[0] - 1].append(city[1])

